import Layout from '../components/PageLayout';

const Index = () => (
  <Layout>
    <div style={{paddingTop:60, paddingLeft:"5vw"}}>
      <img src="/tarasmonitor.png" width="600"></img>
      <div style={{backgroundColor:'green'}}>Hi</div>
    </div>

  </Layout>
);

export default Index;
